import React, { Component } from 'react';
import './footer.css';
import {FaFacebookF} from 'react-icons/fa';
import {FiInstagram} from 'react-icons/fi';
import {IoLogoTwitter} from 'react-icons/io';

class Footer extends Component {
     
    render() {
        return (
             <footer>
               <a href="#" className="footer__logo">ELSAAEID</a>

	       <ul className="permalinks">
				<li><a href="#">Home</a></li>
				<li><a href="#about">About</a></li>
				<li><a href="#experience">Experience</a></li>
				<li><a href="#services">Services</a></li>
				<li><a href="#portfolio">Portfolio</a></li>
				<li><a href="#contact">Contact</a></li>
	       </ul>

	       <div className="footer__socials">
				<a href="https://www.facebook.com/saaed.sadaoy"><FaFacebookF /></a>
				<a href="https://www.instagram.com/saidsadaoy___/"><FiInstagram /></a>
				<a href="https://twitter.com/ElsaaeidEllithy"><IoLogoTwitter /></a>
	       </div>

	       <div className="footer__copyright">
	         <small>&copy; ELSAAEID PORTFOLIO. All rights reserved.</small>
	       </div>
            </footer> 
        )
    };
}
export default Footer;
